import axios from 'axios';
import React, { useState, useEffect } from 'react';
import Nav from 'react-bootstrap/Nav';
import 'bootstrap/dist/css/bootstrap.min.css';
import './leaderboard.css'


const Leaderboard = () => {

    const [type, seType] = useState("coins");
    const [duration, setDuration] = useState("day");

    useEffect(() => {
        console.log(type,duration)
        const handleSubmit = async () => {

            await axios.get('http://localhost:5000/stats/leaderboard',
                {
                    params: {
                        type: type,
                        duration: duration
                    },
                    withCredentials: true
                }
                )
                .then(result => {
                    console.log(result);
                    if (result.data.message === "Request is successfully") {
                        alert('nice');
                    }
                    else {
                        alert(result.data.message);
                    }
                })
                .catch(err => console.log(err));
        }
        handleSubmit()
    }, [type, duration]);


    return (
        <div className="grid-background">
            <div className="containerBoard rounded p-5">
                <h1>Leaderboard</h1>

                <div className="mt-5" >
                    <Nav variant="pills" defaultActiveKey="/home">
                        <Nav.Item>
                            <button 
                            type="button" 
                            className={`btn ${duration === "day" ? "btn-primary" : "btn-outline-secondary"}`}
                            onClick={() => setDuration("day")}
                            >day</button>
                        </Nav.Item>
                        <Nav.Item>
                            <button 
                            type="button" 
                            className={`mx-1 btn ${duration === "month" ? "btn-primary" : "btn-outline-secondary"}`}
                            onClick={() => setDuration("month")}
                            >month</button>
                        </Nav.Item>
                        <Nav.Item>
                            <button 
                            type="button" 
                            className={`btn ${duration === "year" ? "btn-primary" : "btn-outline-secondary"}`}
                            onClick={() => setDuration("year")}
                            >year</button>
                        </Nav.Item>
                    </Nav >
                    <Nav className="mt-3" variant="pills" defaultActiveKey="/home">
                        <Nav.Item>
                            <button 
                            type="button" 
                            className={` btn ${type === "coins" ? "btn-primary" : "btn-outline-secondary"}`}
                            onClick={() => seType("coins")}
                            >coins</button>
                        </Nav.Item>
                        <Nav.Item>
                            <button 
                            type="button" 
                            className={`mx-1 btn ${type === "kills" ? "btn-primary" : "btn-outline-secondary"}`}
                            onClick={() => seType("kills")}
                            >kills</button>
                        </Nav.Item>
                        <Nav.Item>
                            <button 
                            type="button" 
                            className={` btn ${type === "Totalkills" ? "btn-primary" : "btn-outline-secondary"}`}
                            onClick={() => seType("Totalkills")}
                            >Totalkills</button>
                        </Nav.Item>
                    </Nav>
                </div>
                <table className="table mt-5">
                    <thead>
                        <tr>
                            <th>Rank</th>
                            <th>Name</th>
                            <th>xp</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td><b>#4</b></td>
                            <td>
                                <div className="d-flex align-items-center">
                                    <div >
                                        <h5 className="mb-0"><a style={{ color: 'black' }} href="/w`">edik</a> </h5>
                                        <p className="text-muted mb-0"></p>
                                    </div>
                                </div>
                            </td>
                            <td>
                                <h4 className="mr-1">193,526,072</h4>
                            </td>
                        </tr>

                    </tbody>
                </table>
            </div>

        </div>
    )
}

export default Leaderboard
